import React from "react";

const HaulWithRGM = () => {
  return (
    <div style={{ padding: "40px", textAlign: "center" }}>
      <h1>Haul with RGM</h1>
      <p>Welcome! Here you can learn about hauling with RGM.</p>
      {/* You can add more content, images, or CTA buttons */}
    </div>
  );
};

export default HaulWithRGM;
